function WeatherTable() {
  return (
    <div className="weather-container">
      <table>
        <tr>
          <div className="table-header">
            <th>Weather API Results</th>
            <p>Feel free to get creative!</p>
          </div>
        </tr>
        <tr>
          <td className="center">RESULTS HERE</td>
        </tr>
      </table>
    </div>
  );
}
export default WeatherTable;
